		/**
		 * 16进制字符串转中文
		 * @param s
		 * @returns
		 */
		decode:function(s){
			if(s){
				var arr=s.split(",");
				if(arr.length>1){
					var str="";
					for (var i = 0; i < arr.length; i++) {
						if (arr[i]!="") {
							str+=String.fromCharCode(parseInt(arr[i], 16));
						}
					}
					return str;
				}else{
					return s;
				}
			}else{
				return "";
			}
		},
